import React from 'react';
import "../css/hero.css";

const Hero = () => {
  return (
    <section class="hero-background">
        <div class="overlay">
            <div class="container">
                <div class="hero-content">
                    <h1>Welcome to Estendo</h1>
                    <p>Your one-stop shop for all information about your favorite generator and water pump brands, your trusted dealer network in Sumec and other generator brands for over 20 years.</p>
                    <button class="my-btn btn btn-danger mr-2">Select a Generator</button>
                    <button class="btn btn-outline-light">Generator Advice</button>
                </div>
            </div>
        </div>
    </section>
  )
}

export default Hero;
